import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet';
import 'leaflet/dist/leaflet.css';
import L from 'leaflet';
import axios from 'axios';
import '../css/todaydust.css';
import cityMapping from '../region_mapping/cityMapping.js';
import cityCoordinates from '../region_mapping/cityPosition.js';

const TodayDust = () => {
  const [dustData, setDustData] = useState(null);
  const [dbData, setDbData] = useState([]);
  const [apiData, setApiData] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  const API_KEY = 'zhvs5TlKznNkfpG91l4BPgIcZtbsxovufWhyA4%2Bw2KcaA1dp6RsGVOYHyD91i%2FXzDfAqOFIdScVjvbElsw%2BBCQ%3D%3D';

  // Ï†ÑÍµ≠ ÎØ∏ÏÑ∏Î®ºÏßÄ Îç∞Ïù¥ÌÑ∞ Ï°∞Ìöå
  const fetchDustData = async () => {
    try {
      const response = await fetch(
        `https://apis.data.go.kr/B552584/ArpltnStatsSvc/getCtprvnMesureLIst?itemCode=PM10&dataGubun=HOUR&pageNo=1&numOfRows=1&returnType=json&serviceKey=${API_KEY}`
      );
      const data = await response.json();
      return data.response.body.items[0];
    } catch (error) {
      console.error('Error fetching dust data:', error);
      throw error;
    }
  };

  // DB Îç∞Ïù¥ÌÑ∞ Ï°∞Ìöå
  const fetchDbData = async () => {
    try {
      const response = await axios.get('http://127.0.0.1:8000/api/products/');
      console.log('DB Îç∞Ïù¥ÌÑ∞:', response.data); // DB Îç∞Ïù¥ÌÑ∞ ÌôïÏù∏
      return response.data;
    } catch (error) {
      console.error('Error fetching DB data:', error);
      throw error;
    }
  };

  // ÏãúÎèÑÎ≥Ñ ÏÉÅÏÑ∏ Îç∞Ïù¥ÌÑ∞ Ï°∞Ìöå - ÌäπÏ†ï Ï∏°Ï†ïÏÜå Îç∞Ïù¥ÌÑ∞Îßå ÌïÑÌÑ∞ÎßÅ
  const fetchDetailData = async (region, regionDetail) => {
    try {
      console.log('Fetching detail data for:', region, 'regionDetail:', regionDetail); // ÌååÎùºÎØ∏ÌÑ∞ ÌôïÏù∏
      const response = await axios.get(
        `https://apis.data.go.kr/B552584/ArpltnStatsSvc/getCtprvnMesureSidoLIst?sidoName=${region}&searchCondition=DAILY&pageNo=1&numOfRows=100&returnType=json&serviceKey=${API_KEY}`
      );

      // Ï†ÑÏ≤¥ Ï∏°Ï†ïÏÜå Îç∞Ïù¥ÌÑ∞ Ï§ëÏóêÏÑú region_DetailÍ≥º ÏùºÏπòÌïòÎäî Ï∏°Ï†ïÏÜå Îç∞Ïù¥ÌÑ∞Îßå ÌïÑÌÑ∞ÎßÅ
      const allItems = response.data.response.body.items;
      console.log('Î™®Îì† Ï∏°Ï†ïÏÜå Îç∞Ïù¥ÌÑ∞:', allItems); // Ï†ÑÏ≤¥ Îç∞Ïù¥ÌÑ∞ ÌôïÏù∏

      const filteredItems = allItems.filter(item => {
        console.log('ÎπÑÍµê:', item.stationName, regionDetail); // ÌïÑÌÑ∞ÎßÅ Í≥ºÏ†ï ÌôïÏù∏
        return item.stationName === regionDetail;
      });

      console.log('ÌïÑÌÑ∞ÎßÅÎêú Îç∞Ïù¥ÌÑ∞:', filteredItems); // ÌïÑÌÑ∞ÎßÅ Í≤∞Í≥º ÌôïÏù∏
      return filteredItems;
    } catch (error) {
      console.error(`Error fetching detail data for ${region}:`, error);
      return [];
    }
  };

  useEffect(() => {
    const fetchAllData = async () => {
      try {
        setLoading(true);
        // 1. Í∏∞Î≥∏ ÎØ∏ÏÑ∏Î®ºÏßÄ Îç∞Ïù¥ÌÑ∞ Ï°∞Ìöå
        const dustResult = await fetchDustData();
        setDustData(dustResult);

        // 2. DB Îç∞Ïù¥ÌÑ∞ Ï°∞Ìöå
        const dbResult = await fetchDbData();
        setDbData(dbResult);

        // 3. DB Îç∞Ïù¥ÌÑ∞Ïùò regionÍ≥º region_DetailÏùÑ Í∏∞Î∞òÏúºÎ°ú ÏÉÅÏÑ∏ Îç∞Ïù¥ÌÑ∞ Ï°∞Ìöå
        if (dbResult.length > 0) {
          console.log('Ï≤´ Î≤àÏß∏ DB Îç∞Ïù¥ÌÑ∞:', dbResult[0]); // DB Îç∞Ïù¥ÌÑ∞ Íµ¨Ï°∞ ÌôïÏù∏

          const firstRegion = dbResult[0].region;
          const firstRegionDetail = dbResult[0].region_detail; // region_detailÎ°ú ÏàòÏ†ï

          console.log('region:', firstRegion, 'regionDetail:', firstRegionDetail); // Í∞í ÌôïÏù∏

          const detailData = await fetchDetailData(firstRegion, firstRegionDetail);
          setApiData([{ 
            region: firstRegion, 
            regionDetail: firstRegionDetail,
            apiData: detailData 
          }]);
        }
      } catch (error) {
        setError(error.message);
        console.error('fetchAllData ÏóêÎü¨:', error);
      } finally {
        setLoading(false);
      }
    };

    fetchAllData();
  }, []);

  // [ÎÇòÎ®∏ÏßÄ ÏΩîÎìúÎäî ÎèôÏùº...]

  return (
    <div className="dust-container">
      <h2>üåç Ïã§ÏãúÍ∞Ñ ÎåÄÍ∏∞Ïßà Ï†ïÎ≥¥</h2>
      {/* API Îç∞Ïù¥ÌÑ∞ ÌëúÏãú - ÎîîÎ≤ÑÍπÖ Ï†ïÎ≥¥ Ï∂îÍ∞Ä */}
      <div className="api-data-section">
        <h3>ÏßÄÏó≠Î≥Ñ ÏÉÅÏÑ∏ Ï†ïÎ≥¥</h3>
        {dbData.length > 0 && (
          <p>DB Îç∞Ïù¥ÌÑ∞ ÌôïÏù∏: {dbData[0].region} / {dbData[0].region_detail}</p>
        )}
        <ul className="api-data-list">
          {apiData.map((data) => (
            <li key={data.region} className="api-data-item">
              <h4>{data.region} - {data.regionDetail} Ï∏°Ï†ïÏÜå Ï†ïÎ≥¥</h4>
              {data.apiData.length === 0 ? (
                <p>Ìï¥Îãπ Ï∏°Ï†ïÏÜåÏùò Îç∞Ïù¥ÌÑ∞Í∞Ä ÏóÜÏäµÎãàÎã§.</p>
              ) : (
                data.apiData.map((item, index) => (
                  <div key={index} className="measurement-info">
                    <p>Ï∏°Ï†ïÏÜå: {item.stationName}</p>
                    <p>PM10: {item.pm10Value}„éç/m¬≥</p>
                    <p>PM2.5: {item.pm25Value}„éç/m¬≥</p>
                  </div>
                ))
              )}
            </li>
          ))}
        </ul>
      </div>

      {/* [ÎÇòÎ®∏ÏßÄ JSXÎäî ÎèôÏùº...] */}
    </div>
  );
};

export default TodayDust;
